(14, '2025-01-06', 'Teknis', 'Pengecekan jaringan', 'Merapikan jaringan', 'Box panel di jalan masuk lingkungan Karang Tatah tidak memiliki sambungan fase ke kWh meter. Perbaikan dapat dilakukan dengan menyambungkan ulang kabel fase.\nMelakukan pergantian konektor 1 buah.', 113, 2, '2025-03-09 16:20:25', '2025-03-09 16:21:56', 'Peralatan kelistrikan', '1 buah travo, 1 buah kapasitor, 1 buah fiting, 1 buah foto cell, 1 meter kabel NYA, 1 meter kabel NYM'),
(15, '2025-01-06', 'Teknis', 'Pengecekan jaringan', 'Merapikan jaringan', 'Box panel di Jalan Sriwijaya, tepatnya di depan gapura Lingkungan Taman Baru, memiliki MCB kWh berkapasitas 20 Ampere (4400 VA). Saat ini, beban arus yang digunakan sama dengan kapasitas MCB kWh meter.\nSebelumnya, suplai listrik dari S4 Golkar hingga S4 Taman menggunakan dua box panel meter, namun kini hanya menggunakan satu box panel meter. Dengan kapasitas 20 Ampere dan total 24 lampu (di mana setiap tiang memiliki dua lampu dengan konsumsi sekitar 3 Ampere per tiang), daya yang tersedia tidak mencukupi untuk kebutuhan saat ini.\nUntuk memastikan operasional yang stabil, diperlukan penambahan daya guna menyesuaikan dengan beban yang ada.', 46, 2, '2025-03-09 16:28:51', '2025-03-09 16:44:36', 'Peralatan kelistrikan', '1 buah travo, 1 buah kapasitor, 1 buah fiting, 1 buah foto cell, 1 meter kabel NYA, 1 meter kabel NYM'),
